import { isRejected } from "@reduxjs/toolkit";
import axios from "axios";
export const getAllTickets = () => {
  return new Promise(async (resolve, reject) => {
    try {
      const result = axios.get("http://localhost:3001/v1/ticket", {
        headers: {
          Authorization:
            "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6Im9rb3BAcC5jb20iLCJpYXQiOjE2MjUxMjU5MzIsImV4cCI6MTYyNTEyOTUzMn0.pAmCg7dobSRa8wYHhYljZJQTJBRbwOTsFBMXhtaH1T4",
        },
      });
      resolve(result);
    } catch (error) {
      reject(error);
    }
  });
};
